import './Main.css';

function Main(){
    return (
        <div className='main'>
            <div className='options'>
                <div><a href="http://google.com">Collage</a></div>
                <div><a href="http://google.com">Staged scrolling</a></div>
                <div><a href="http://google.com">Carousel</a></div>
            </div>
        </div>
    );
}
export default Main;
